import React from "react";
import { BrowserRouter } from "react-router-dom";
import MainNavigation from "./Navigation/MainNavigation";

const Home = () => {
  return (
    <>
    <BrowserRouter>
    </BrowserRouter>
      <MainNavigation />
      <div className="sk-spinner sk-spinner-pulse">
        <h1>Welcome</h1>
      </div>
    </>
  );
};
export default Home;
